<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, user-scalable=no">
    <title>Create Message</title>
    <link rel="stylesheet" href="./styles/style.css">
    <link rel="shortcut icon" href="<?= Config::APP['favicon'] ?>" type="image/x-icon">
</head>
<body>
    <div class="container">
        <h1>Create Message</h1>
        <div class="description">
            <p>Share your messages easily with SendKMI - a simple and efficient message sharing service.</p>
            <h3>Features:</h3>
            <ul>
                <li>Add <span style="background-color: var(--brand-color); padding: 3px;">?hl</span> to any message URL to enable line numbers and syntax highlighting</li>
                <li>Check your IP address at <a href="/ip">/ip</a></li>
                <li>Test your connection latency at <a href="/ping">/ping</a></li>
                <li>Full IPv6 support</li>
            </ul>
        <form id="messageForm" class="message-form" method="post">
            <textarea id="message" name="message" placeholder="Enter your message..." required></textarea>
            <button type="submit" id="submitButton">Send</button>
        </form>
        <div id="response" class="response-area"></div>
        <div class="github-link">
            <a href="<?= Config::APP['repository'] ?>" target="_blank">
                <img src="data:image/svg+xml;base64," alt="GitHub" width="32" height="32">
                repository
            </a>
        </div>
    </div>
    <script src="./scripts/main.js"></script>
</body>
</html>